import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Card, ListGroupItem, ListGroup, Container } from 'react-bootstrap';


class StockComp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: this.props.list.name,
            stockPrice: this.props.list.stockPrice,
            perform: this.props.list.perform,
            sector: this.props.list.sector,
            tag: this.props.list.tag
        }
        console.log(this.state.name)
    }

    render() {
        return (
            <Card style={{ width: '18rem' }}>
            <Card.Body>
                <Card.Title>{this.state.name}</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">{this.state.tag}</Card.Subtitle>
                <Card.Text><b>Current Price: </b>$ {this.state.stockPrice}</Card.Text>
                <Card.Text><b>Performance: </b>{this.state.perform}%</Card.Text>
                <Card.Text><b>Sector: </b>{this.state.sector}</Card.Text>
                <Card.Link href="#">Purchase Stock</Card.Link>
            </Card.Body>
            </Card>
        )
    }
}


export default StockComp;
